import React, { Component } from "react";
import *  as customer from "../CutomerList/CustomerList.style";
import ButtonText from "../../../components/ButtonText/ButtonText";
import { getCustomer } from "../../../action/customer";
import { connect } from "react-redux";

class CustomerList extends Component {
  componentDidMount() {
    this.props.getCustomer();
  }
  render() {
    const { employees } = this.props;
    return (
      <customer.Container>

          <customer.Grid_item >First Name</customer.Grid_item>
          <customer.Grid_item >Last Name</customer.Grid_item>
          <customer.Grid_item >Email</customer.Grid_item>
          <customer.Grid_item >Phone</customer.Grid_item>
          <customer.Grid_item >Address</customer.Grid_item>
          <customer.Grid_item >City</customer.Grid_item>
          <customer.Grid_item >State</customer.Grid_item>
          <customer.Grid_item >Zip Code</customer.Grid_item>
          <customer.Grid_item >Country</customer.Grid_item>
          <customer.Grid_item >Company</customer.Grid_item>
          <customer.Grid_item >Action</customer.Grid_item>
        {employees && employees.map((item,index)=>{
          return(
            <p>
            <customer.Grid_item key={index++} >{item.fname}</customer.Grid_item>
            <customer.Grid_item >9</customer.Grid_item>
            <customer.Grid_item >9</customer.Grid_item>
            <customer.Grid_item >9</customer.Grid_item>
            <customer.Grid_item >9</customer.Grid_item>
            <customer.Grid_item >9</customer.Grid_item>
            <customer.Grid_item >9</customer.Grid_item>
            <customer.Grid_item >9</customer.Grid_item>
            <customer.Grid_item >9</customer.Grid_item>
            <customer.Grid_item >9</customer.Grid_item>
            <customer.Grid_item >9</customer.Grid_item>
            </p>
          )
        }


        )}


      </customer.Container>
    );
  }
}

const mapStateToProps = (state) => {
  return {
    employees: state.employees,
  };
};
export default connect(mapStateToProps, { getCustomer })(CustomerList);
